(function ($, Drupal) {
  'use strict';

  $('.form-autocomplete').keydown(function (e) {
    $(e.target).prev('.uk-form-icon').addClass('icon-spin');

  });

  Drupal.autocomplete.options.search = function(e) {
    $(e.target).prev('.uk-form-icon').removeClass('icon-spin');
  };
})(jQuery, Drupal);
